import React, { useState,useEffect } from 'react'
import Cancel from '../Button/Cancel';


const WeeklyUpdate = (props) => {
  const initialValues = {
    TMFixedCost:"",
    resourcesused:"",
    WeeklyCompletion:"",
    FeaturesStories:"",
    FeaturesCompleted:"",
    NewBugs:"",
    Bugs:"",
    CodeReview:"",
    UnitTesting:"",
    WeeklyCommunication:"",
    Dependencies:"",
    RisksMitigation:"",
    Risks:"",
    SupportRequired:""
}
  const [formValues, setFormValues] = useState(initialValues);
  const [formErrors, setFormErrors] = useState(false);
  const [isSubmit, setIsSubmit] = useState(false);

  const handleChange=(e)=>{
    const{name,value}=e.target;
    setFormValues({...formValues,[name]:value});
    console.log(formValues);
  };

  const handleSubmit=(e)=>{
    e.preventDefault() ;
    validate(formValues)

  const validate=(values) => {
     if(TMFixedCost.length===0)
     {
       setFormErrors(true);
     }
     if(WeeklyCompletion.length===0)
     {
      setFormErrors(true);
     }
     if(FeaturesCompleted.length===0)
     {
      setFormErrors(true);
     }

     if(Dependencies.length===0)
     {
      setFormErrors(true);
     }
     if(RisksMitigation.length===0)
     {
      setFormErrors(true);
     }
     if(Risks.length===0)
     {
      setFormErrors(true);
     }
     if(SupportRequired.length===0)
     {
      setFormErrors(true);
     }
   }
  }


  return (props.trigger) ? (

    <form style={{
      position: "absolute",
      width: "100%",
      top: "2rem",
      left: "0%",
      backgroundColor: "rgba(0,0,0,0.5",
    }} 
    onSubmit={handleSubmit} 
  >


      <div className='WeeklyUpdate'>

        <div className='WeeklyUpdate_Head'>
          <h1 className='WeeklyUpdate_Head_Title'>Weekly Update</h1>
        </div>



        <div className='WeeklyUpdate_Overalldetail'>

          <h1 className='WeeklyUpdate_Overalldetail_Title'>Overall Detail</h1>

          <div className='WeeklyUpdate_Overalldetail_Field'>
            <div className='WeeklyUpdate_Overalldetail_Field_All'>
              <label className='WeeklyUpdate_Overalldetail_Field_All_label'>T&M/Fixed Cost</label><br />
              <input className="WeeklyUpdate_Overalldetail_Field_All_input" 
                     type="text" 

                     placeholder='Enter T&M/Fixed Cost '
                       onChange={handleChange} 
                    />
                    {formErrors ? <p className='ErrorMessage'>*Required</p> : ""}
            </div>


            <div className='WeeklyUpdate_Overalldetail_Field_All' >
              <label className='WeeklyUpdate_Overalldetail_Field_All_label'>No.of resources used</label><br />
              <select className="WeeklyUpdate_Overalldetail_Field_All_input" 
                      type="text"
                      value={formValues.resourcesused} />
            </div>

            <div className='WeeklyUpdate_Overalldetail_Field_All' >
              <label className='WeeklyUpdate_Overalldetail_Field_All_label'>Weekly% Completion</label><br />
              <input className="WeeklyUpdate_Overalldetail_Field_All_input" 
                     type="text"
                     value={formValues.WeeklyCompletion}
                     onChange={handleChange}  />
                      <p className='ErrorMessage'>{formErrors.WeeklyCommunication}</p>

            </div>
          </div>

        </div>




        <div className='WeeklyUpdate_Weeklydetail'>

          <h1 className='WeeklyUpdate_Weeklydetail_Title'>Weekly Detail</h1>

